__author__ = 'monica_wang'
import random
import time

def partition(array, l, r, pivotId):
    if r - l == 0:
        return 0
    global  cnt
    cnt += r - l

    array[l], array[pivotId] = array[pivotId] , array[l]

    i = l+1
    for j in range(l+1, r+1):
        if array[j] < array[l]:
            array[i], array[j] = array[j], array[i]
            i += 1

    array[l], array[i-1] = array[i-1], array[l]
    return i-1

def choosePivot(array, l, r):
    #pivotId = random.randrange(l, r)
    #pivotId = l
    m = (l + r)/2
    maximum = max(array[r], array[l], array[m])
    minimum = min(array[r], array[l], array[m])
    if array[m] != maximum and array[m] != minimum:
        return m
    if array[l] != maximum and array[l] != minimum:
        return l
    else:
        return r

def quicksort(array, l, r):
    if r - l <= 0:
        return

    pivotId = random.randrange(l, r)
    #pivotId = l
    #pivotId = choosePivot(array, l, r)
    i = partition(array, l, r, pivotId)

    quicksort(array, l, i-1)
    quicksort(array, i+1, r)

random.seed(time.time())

